	<strong>ILVA NUBIA HERRERA G&Aacute;LVEZ</strong>, mayor de edad, vecina y residente en esta ciudad, identificada con la c&eacute;dula de ciudadan&iacute;a No. 41.780.295 de Bogot&aacute;, en mi calidad de Directora Jur&iacute;dica de Metrovivienda, nombrada mediante Resoluci&oacute;n&nbsp; No. 120&nbsp; del 29 de octubre de 2013, debidamente posesionada mediante Acta No. 79 del primero de noviembre de 2013, con funciones de Representaci&oacute;n Legal de <strong>METROVIVIENDA</strong>, persona jur&iacute;dica de derecho p&uacute;blico, Empresa y Industrial y Comercial del Orden Distrital, creada por el Acuerdo 15 de 1998, vinculada a la Secretar&iacute;a Distrital del H&aacute;bitat de la Alcald&iacute;a Mayor de Bogot&aacute;, mediante Acuerdo 257 del 30 de noviembre de 2006 del Concejo de Bogot&aacute;, dentro del t&eacute;rmino de un (1) d&iacute;a concedido por el despacho,&nbsp; procedo a dar respuesta a la acci&oacute;n de tutela se&ntilde;alada en la referencia, pronunci&aacute;ndome&nbsp; en relaci&oacute;n con los hechos que son materia de la misma,&nbsp; bajo el marco de competencia de la Entidad, por cuanto podemos informar que por las razones que expondremos&nbsp; en la presente, no es Metrovivienda la entidad Distrital actualmente responsable de administrar y otorgar los recursos del Subsidio Distrital de Vivienda, siendo esta la Secretar&iacute;a Distrital del H&aacute;bitat quien inscribe, postula, califica, asigna y entrega los recursos del subsidio a los hogares que seg&uacute;n la reglamentaci&oacute;n pueden acceder al Subsidio Distrital de Vivienda.<br />
	<br />
	Sobre el particular procedo ante el Despacho de conocimiento a proponer de manera previa la siguiente:</p>
<p style="text-align: center;">
	<br />
	<u><strong>EXCEPCI&Oacute;N DE M&Eacute;RITO</strong></u></p>
<p style="text-align: justify;">
	<br />
	En primera instancia es importante indicar que en visi&oacute;n del accionante los hechos por &eacute;l se&ntilde;alados derivan en una supuesta amenaza o vulneraci&oacute;n a los siguientes derechos fundamentales: (1) A la Igualdad y no discriminaci&oacute;n ante la Ley (art. 13); (2) Derecho de Petici&oacute;n (art. 23), (3) al M&iacute;nimo Vital,&nbsp; (5) A la vida en conexidad a la dignidad humana, (6) (7) protecci&oacute;n especial a la familia, (8) protecci&oacute;n especial a las mujeres, ni&ntilde;os y ancianos, frente a los cuales plantea carencia de acciones tendientes a la estabilizaci&oacute;n de su situaci&oacute;n, hechos estos que no encuentran relaci&oacute;n con la competencia de Metrovivienda, tal como se explicar&aacute; en detalle en apartados posteriores.<br />
	<br />
	En ese orden de ideas, interpongo al Despacho judicial<strong> FALTA DE LEGITIMACI&Oacute;N EN LA CAUSA POR PASIVA</strong>, toda vez que en relaci&oacute;n con ninguno de los hechos narrados, Metrovivienda en la actualidad tiene dentro de sus competencias&nbsp; la posibilidad de brindar&nbsp; estabilizaci&oacute;n socioecon&oacute;mica, y&nbsp; especificamos que en cuanto&nbsp; al otorgamiento de Subsidios de Vivienda adem&aacute;s de que a la fecha esta entidad no tiene competencia para otorgar Subsidios Distritales de Vivienda, como se narrar&aacute;&nbsp; en apartados posteriores, la presunta vulneraci&oacute;n radica en el hecho de no haber obtenido Subsidio Familiar de Vivienda tramitado ante una caja de compensaci&oacute;n familiar y otorgado por Fonvivienda, requisito sin el cual es imposible normativamente la asignaci&oacute;n de un Subsidio Distrital de Vivienda,<u> esto &uacute;ltimo se reitera, no siendo ya de competencia de esta entidad puesto que mediante el Decreto Distrital 583 de 2007 se le asign&oacute; a la Secretar&iacute;a Distrital del H&aacute;bitat la competencia para su otorgamiento y asignaci&oacute;n,</u> funci&oacute;n que se le hab&iacute;a otorgado a Metrovivienda a trav&eacute;s de los Decretos Distritales 226 de 2005 y 200 de 2006, derogados por el Decreto Distrital 063 de 2009, a su vez derogado por el Decreto Distrital 539 del 23 de noviembre de 2012, por lo tanto y de acuerdo al ordenamiento jur&iacute;dico de creaci&oacute;n de la entidad, esta tiene como prop&oacute;sito esencial asuntos diferentes a los alegados por el actor de tutela, siendo ellos:</p>
<p style="text-align: justify;">
	<br />
	<em>&ldquo;...A. Promover la oferta masiva de suelo urbano para facilitar la ejecuci&oacute;n de Proyectos Integrales de Vivienda de Inter&eacute;s Social.<br />
	B. Desarrollar las funciones propias de los bancos de tierras o bancos inmobiliarios, respecto de inmuebles destinados en particular para la ejecuci&oacute;n de proyectos urban&iacute;sticos que contemplen la provisi&oacute;n de Vivienda de Inter&eacute;s Social Prioritaria.<br />
	C. Promover la organizaci&oacute;n comunitaria de familias de bajos ingresos para facilitar su acceso al suelo destinado a la vivienda de inter&eacute;s social prioritaria.&rdquo;.</em></p>
<p style="text-align: center;">
	<br />
	<br />
	<u><strong>PRONUNCIAMIENTO FRENTE A LOS HECHOS DE LA ACCI&Oacute;N:</strong></u></p>
<p style="text-align: justify;">
	<br />
	No se puede considerar en el presente caso responsable a METROVIVIENDA por los derechos fundamentales supuestamente vulnerados y especialmente en lo que concierne a su necesidad de contar con una soluci&oacute;n habitacional definitiva, obteniendo para el efecto el subsidio familiar de vivienda que a la fecha no le ha sido otorgado, para luego y en caso de que este le haya sido asignado en la ciudad de Bogot&aacute;, iniciar el proceso tendiente a la obtenci&oacute;n del Subsidio Distrital de Vivienda.<br />
	<br />
	As&iacute; las cosas, nos pronunciaremos sobre los hechos alegados de la siguiente manera:<br />
	<br />
	Como primera medida debemos informar que el accionante se&ntilde;or WILSON GUTIERREZ MAHECHA C.C. 31.133.775 de Cimitarra,&nbsp;&nbsp; a la fecha, no ha presentado peticiones ante la entidad y&nbsp; por tal raz&oacute;n Metrovivienda nunca ha incurrido en desconocimiento del art&iacute;culo 33 del C&oacute;digo de Procedimiento Administrativo y de lo Contencioso Administrativo.<br />
	<br />
	<em>En cuanto a la asignaci&oacute;n de subsidios,&nbsp; el WILSON GUTIERREZ MAHECHA C.C. 31.133.775 de Cimitarra&nbsp;&nbsp;&nbsp;&nbsp; ,&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; manifiesta en la demanda de tutela&nbsp; que: &ldquo;Por otra parte,&nbsp; el no asignar oportunamente los subsidios de vivienda por parte de <strong>FONVIVIENDA</strong>, nos perjudica, ya que la administraci&oacute;n Distrital hace entrega de un subsidio de vivienda a los desplazados que nos encontramos en la ciudad de Bogot&aacute;, previo a la entrega del subsidio nacional como complemento para la soluci&oacute;n habitacional debemos, porque de no ser as&iacute;,&nbsp; se nos estar&iacute;a vulnerando el derecho a la igualdad. Para acreditar mi afirmaci&oacute;n, ruego al se&ntilde;or Juez requerir a la Alcald&iacute;a Mayor&nbsp; de Bogot&aacute;, con el fin de que esta, corrobore mi informaci&oacute;n, con el fin de que su&nbsp; fallo se ajuste a derecho.&rdquo; </em>(Folio 9 de la acci&oacute;n de tutela)<br />
	&nbsp;<br />
	METROVIVIENDA en la actualidad no inscribe, postula, asigna ni desembolsa el Subsidio Distrital de Vivienda, esta competencia est&aacute; a cargo de la Secretaria Distrital del H&aacute;bitat.<br />
	<br />
	De igual manera, Metrovivienda no puede efectuar ning&uacute;n pronunciamiento respecto a las ayudas de atenci&oacute;n a la poblaci&oacute;n desplazada, toda vez, que su objeto se encuentra encaminado entre otros a promover la oferta masiva del suelo urbano para facilitar la ejecuci&oacute;n de proyectos integrales de vivienda de inter&eacute;s social, desarrollar las funciones propias de los bancos de tierras o bancos inmobiliarios, respecto de inmuebles destinados en particular para la ejecuci&oacute;n de proyectos urban&iacute;sticos que contemplen la provisi&oacute;n de vivienda de inter&eacute;s social y prioritario, y promover la organizaci&oacute;n comunitaria de familias de bajos ingresos para facilitar el acceso al suelo destinado a este tipo de soluci&oacute;n habitacional, pero en la actualidad no tiene competencia sobre administraci&oacute;n de subsidios.<br />
	<br />
	Se insiste en que <strong>METROVIVIENDA</strong> no es la entidad distrital encargada de administrar y otorgar el Subsidio Distrital de Vivienda, por lo tanto no contamos con los elementos normativos, financieros y log&iacute;sticos para asignar subsidios, como se indic&oacute; anteriormente. Actualmente, esta funci&oacute;n la cumple la Secretar&iacute;a Distrital del H&aacute;bitat.<br />
	<br />
	Con el fin de brindar una estabilizaci&oacute;n socioecon&oacute;mica a la poblaci&oacute;n desplazada y en cumplimiento de las directrices contenidas en diferentes Sentencias y Autos proferidos por la Corte Constitucional, entre otras la Sentencia T-025 de 2004, el Alcalde Mayor de Bogot&aacute;, expidi&oacute; el Decreto Distrital 200 de 20061, norma que actualmente se encuentra derogada <strong>otorg&aacute;ndole tal competencia a la Secretar&iacute;a Distrital del H&aacute;bitat, confiri&eacute;ndole la facultad de convocar, postular y asignar Subsidios Distritales de Vivienda2</strong> para las modalidades de adquisici&oacute;n de vivienda nueva o usada, mejoramiento de vivienda y construcci&oacute;n en sitio propio, con el fin de brindar un apoyo a las <strong>soluciones habitacionales</strong> de la poblaci&oacute;n desplazada.<br />
	<br />
	La Alcald&iacute;a Mayor de Bogot&aacute; expidi&oacute; el Decreto Distrital 063 del 2 de marzo de 2009 que reglament&oacute; el otorgamiento del Subsidio Distrital de Vivienda, el cual fue derogado por el Decreto Distrital 539 del 23 de noviembre de 2012<em> &quot;Por el cual se reglamenta el subsidio distrital de vivienda en especie en el marco del Plan de Desarrollo Econ&oacute;mico, Social, Ambiental y de Obras P&uacute;blicas Para Bogot&aacute; D. C. 2012 - 2016 - Bogot&aacute; Humana&quot;</em>,&nbsp; que igualmente considera la situaci&oacute;n de la poblaci&oacute;n desplazada y contin&uacute;a otorgando el SDV complementario al Subsidio Familiar de Vivienda que otorga el Gobierno Nacional, en los t&eacute;rminos de la ley 1537 de 2012, ley de vivienda.<br />
	<br />
	La Secretar&iacute;a Distrital del H&aacute;bitat en el marco del Decreto Distrital 539 de noviembre 23 de 2012 expidi&oacute; el Reglamento Operativo para el otorgamiento del Subsidio Distrital de Vivienda en Especie para Vivienda de Inter&eacute;s Prioritario en el Distrito Capital a trav&eacute;s de la Resoluci&oacute;n 176 del 2 de abril de 2013, determinando en el art&iacute;culo 5 que dentro de los hogares que pueden tener acceso al subsidio, est&aacute;n los hogares v&iacute;ctimas del conflicto interno armado.<br />
	<br />
	As&iacute; mismo, es pertinente precisar que los art&iacute;culos 12&ordm; y 39&deg; de la Resoluci&oacute;n 176 del 2 de abril de 2013<em> &ldquo;Por medio de la cual se adopta el reglamento operativo para el otorgamiento del Subsidio Distrital de Vivienda en Especie para Vivienda de Inter&eacute;s Prioritario en el Distrito Capital, en el marco del Decreto Distrital 539 de 2012&rdquo;</em>, establece los requisitos que deben cumplir los hogares en situaci&oacute;n de desplazamiento interno forzado por la violencia, para acceder al Subsidio Distrital de Vivienda, los cuales se trascriben:<br />
	<br />
	<em>&ldquo;ART&Iacute;CULO 12. Cierre financiero. (&hellip;) En el caso de hogares v&iacute;ctimas del desplazamiento forzado por el&nbsp; conflicto interno, estos deber&aacute;n acreditar que cuentan con el subsidio asignado por Fonvivienda, por el Banco Agrario de Colombia o las entidades que hagan sus veces&hellip;&rdquo;.<br />
	&nbsp;&nbsp; &nbsp;<br />
	&ldquo;ART&Iacute;CULO 39. Requisitos b&aacute;sicos para tener derecho al SDVE. El hogar debe cumplir con los siguientes requisitos para acceder al SDVE por cualquiera de los cuatro esquemas establecidos:</em><br />
	<br />
	<em>1. Que el hogar se encuentre inscrito en el Sistema de Informaci&oacute;n para la Financiaci&oacute;n de Soluciones de Vivienda &ndash; SIFSV- de la Secretar&iacute;a Distrital del H&aacute;bitat - SDHT.<br />
	2. Que al menos una de las personas que integran el hogar tenga ciudadan&iacute;a colombiana, se encuentre en capacidad de obligarse por s&iacute; misma y resida en Bogot&aacute;.<br />
	3. Que los ingresos totales mensuales del hogar no sean superiores al equivalente a cuatro (4) salarios m&iacute;nimos legales mensuales vigentes &ndash; SMLMV, sin perjuicio de la aplicaci&oacute;n de criterios de priorizaci&oacute;n.<br />
	4. Que ninguna persona integrante del hogar se encuentre afiliada a una caja de compensaci&oacute;n familiar que le permita acceder a un subsidio de vivienda otorgado con recursos de esas entidades.<br />
	5. Que ninguno de los integrantes del hogar haya adquirido una vivienda con recursos procedentes del subsidio nacional de vivienda, del subsidio distrital de vivienda o de los subsidios otorgados por las cajas de compensaci&oacute;n familiar.<br />
	6. Que ninguna de las personas que integran el hogar sea propietaria o poseedora de vivienda en el territorio nacional. Lo anterior no aplica para la propiedad o posesi&oacute;n de terrenos ubicados en zonas de alto riesgo no mitigable o que correspondan a ronda hidr&aacute;ulica o&nbsp; zona de manejo y protecci&oacute;n ambiental &ndash; ZMPA, o de terrenos donde sea imposible la conexi&oacute;n a servicios p&uacute;blicos domiciliarios de acueducto y alcantarillado. Este requisito no aplica para las modalidades de mejoramiento de vivienda.</em><br />
	<br />
	<em><strong>PAR&Aacute;GRAFO 1.</strong>&nbsp; Los hogares v&iacute;ctimas del desplazamiento por el conflicto interno deber&aacute;n estar inscritos en el Registro &Uacute;nico de V&iacute;ctimas y ninguna de la personas que integran el&nbsp; hogar podr&aacute; ser propietaria o poseedora de una vivienda en lugar diferente al sitio de desplazamiento. (&hellip;)&rdquo;.</em><br />
	<br />
	Es importante se&ntilde;alar que el Subsidio Distrital de Vivienda en Especie es complementario al Subsidio Familiar de Vivienda con relaci&oacute;n a la poblaci&oacute;n desplazada, conforme lo establecido en el Decreto Nacional 1168 de 1996 toda vez que estableci&oacute; en su art&iacute;culo 1&deg;, que los subsidios para vivienda de inter&eacute;s social que los municipios decidan otorgar son complementarios al subsidio nacional de vivienda y podr&aacute;n ser entregados en dinero o en especie, seg&uacute;n lo determinen las autoridades municipales competentes.<br />
	<br />
	Adicional a lo anterior, en el marco de nuestras competencias le informamos que la Administraci&oacute;n Distrital, dentro de su pol&iacute;tica no otorga viviendas 100% subsidiadas, pues este&nbsp; programa hace parte de la pol&iacute;tica habitacional del Gobierno Nacional.<br />
	<br />
	<strong>Observ&aacute;ndose con lo anterior, que el Distrito Capital ni Metrovivienda, han incumplido o presuntamente violado los derechos enunciados por la accionante y los otorgados por la Ley y por v&iacute;a jurisprudencial a la poblaci&oacute;n desplazada, tal como ya se ha fallado sobre lo mismo en instancias judiciales.</strong><br />
	<br />
	Adicional a lo anterior, el Concejo de Bogot&aacute;, D.C., mediante el Acuerdo 468 de 2011, autoriz&oacute; al Alcalde Mayor para aplicar el Subsidio Distrital de Vivienda para Hogares que se encuentren en situaci&oacute;n de desplazamiento interno forzado por la violencia en &aacute;reas por fuera del per&iacute;metro del Distrito Capital, con el fin de facilitar su retorno, al respecto contempla:</p>
<p style="text-align: justify;">
	<br />
	<em><strong>&ldquo;ART&Iacute;CULO 1</strong>&ordm;.- Autorizar al Alcalde Mayor para aplicar el Subsidio Distrital de Vivienda para Hogares que se encuentren en situaci&oacute;n de Desplazamiento Interno Forzado por la Violencia para su reubicaci&oacute;n o retorno.<br />
	<strong>ART&Iacute;CULO 2</strong>. El Subsidio Distrital de Vivienda para Hogares en condici&oacute;n de Desplazamiento Interno Forzado por la Violencia ser&aacute; asignado para aquellos que se encuentren inscritos en el Distrito Capital en el Registro &Uacute;nico de Poblaci&oacute;n Desplazada.<br />
	<strong>ART&Iacute;CULO 3</strong>. El monto que se otorgue como Subsidio Distrital de Vivienda a cada hogar en situaci&oacute;n de Desplazamiento Interno Forzado ser&aacute; hasta por el mismo valor del subsidio de vivienda que otorga el gobierno Nacional.<br />
	<strong>ART&Iacute;CULO 4</strong>. La Secretar&iacute;a Distrital del H&aacute;bitat informar&aacute; al alcalde municipal del lugar en el que se aplique el subsidio distrital de vivienda, a las entidades distritales y a FONVIVIENDA, para los efectos de su competencia.<br />
	<strong>ART&Iacute;CULO 5</strong>. La administraci&oacute;n distrital establecer&aacute; el procedimiento para el desembolso del Subsidio Distrital de Vivienda...&rdquo;</em></p>
<p style="text-align: justify;">
	<br />
	En ese orden de ideas, el <strong>Distrito Capital y en especial Metrovivienda no han incumplido o presuntamente violado los derechos enunciados por la accionante y los otorgados por la Ley y por v&iacute;a jurisprudencial a la poblaci&oacute;n desplazada</strong>, toda vez que Metrovivienda y la Secretar&iacute;a Distrital del H&aacute;bitat, han contribuido al mejoramiento de las condiciones socioecon&oacute;micas de la poblaci&oacute;n desplazada, asignando recursos econ&oacute;micos a trav&eacute;s del Subsidio Distrital de Vivienda, para cubrir las necesidades habitacionales que tiene la poblaci&oacute;n en esta situaci&oacute;n, dirigiendo de esta manera la actuaci&oacute;n de la Administraci&oacute;n Distrital al cumplimiento de los fines consagrados en el<strong> art&iacute;culo 13 y 51 de la Constituci&oacute;n Pol&iacute;tica3.</strong><br />
	<br />
	En cuanto a la estabilizaci&oacute;n socioecon&oacute;mica. Es necesario indicar que esta obligaci&oacute;n es competencia del&nbsp; Departamento Administrativo para la prosperidad Social.<br />
	<br />
	As&iacute;, Metrovivienda no desarrolla ni fomenta proyectos productivos, ni tiene injerencia alguna en la toma de las decisiones adoptadas por los entidades del Estado en otros niveles, como el Departamento Administrativo para la prosperidad Social, puesto que no hace parte del sector central de la rama ejecutiva del poder p&uacute;blico en el orden nacional. En tal sentido, no es la llamada a responder o al menos presentar justificaci&oacute;n acerca de las presuntas dilaciones en que haya incurrido o pueda incurrir la citada dependencia presidencial frente al accionante.<br />
	<br />
	Con claridad en cuanto a lo anterior, s&oacute;lo con fines ilustrativos y sin perjuicio de lo que manifieste el Departamento Administrativo para la Prosperidad Social al momento de contestar esta acci&oacute;n, resulta pertinente indicar que en cuanto a la integraci&oacute;n de la poblaci&oacute;n en situaci&oacute;n de desplazamiento al desarrollo de proyectos productivos por parte del Gobierno Nacional, es &eacute;ste quien define -de acuerdo con sus disponibilidades- las condiciones y requisitos que deben reunir la poblaci&oacute;n desplazada en general y la accionante en particular, para tener derecho al auxilio econ&oacute;mico.<br />
	<br />
	Ello con fundamento en las siguientes razones de derecho:<br />
	<br />
	La Ley 387 de 1997 dispone que el Fondo Nacional para la Atenci&oacute;n Integral a la Poblaci&oacute;n en Situaci&oacute;n de Desplazamiento interno forzado por la Violencia tiene por objeto</p>
<p style="text-align: justify;">
	<em>&ldquo;financiar y/o cofinanciar los programas de prevenci&oacute;n del desplazamiento, de atenci&oacute;n humanitaria de emergencia, de retorno, de estabilizaci&oacute;n y consolidaci&oacute;n socioecon&oacute;mica y la instalaci&oacute;n y operaci&oacute;n de la Red Nacional de Informaci&oacute;n.&rdquo;<br />
	<br />
	Por su parte, el art&iacute;culo 25 de la misma ley ordena que &ldquo;el Gobierno Nacional har&aacute; los ajustes y traslados presupuestales correspondientes en el Presupuesto General de la Naci&oacute;n para dejar en cabeza del Fondo las apropiaciones necesarias para el cumplimiento de sus objetivos&rdquo;.<br />
	<br />
	Adicionalmente los art&iacute;culos 16, 17, 20, 21, 22, 25, 26 y 27 del Decreto 2569 de 2000, reglamentario de la ley 387 de 1997, condicionaron el acceso, tanto a la ayuda humanitaria de emergencia como a los programas de estabilizaci&oacute;n socioecon&oacute;mica, a la existencia de disponibilidades presupuestales. A manera de ejemplo, el art&iacute;culo 22 dispone que &ldquo;en atenci&oacute;n a los principios de solidaridad y de proporcionalidad, la Red de Solidaridad Social destinar&aacute; de los recursos que para tal fin reciba del presupuesto nacional y de manera proporcional al tama&ntilde;o y composici&oacute;n del grupo familiar, un monto m&aacute;ximo equivalente en bienes y servicios, de acuerdo con la disponibilidad presupuestal.&rdquo;</em><br />
	<br />
	De acuerdo con lo expuesto y en virtud de lo resuelto por la Corte Constitucional en la sentencia T-025 de 2002, el Gobierno Nacional debe garantizar la protecci&oacute;n de la poblaci&oacute;n desplazada, por lo cual le resulta imperioso destinar el presupuesto necesario para que los derechos fundamentales de este grupo de persona tengan plena garant&iacute;a. As&iacute; las cosas, el Gobierno Nacional es el encargado de organizar las disponibilidades presupuestales para atender a la poblaci&oacute;n desplazada, de conformidad con los recursos de los que disponga para ello y con respeto a algunos factores de atenci&oacute;n prioritaria<br />
	<br />
	Ahora bien, para el caso de la poblaci&oacute;n en situaci&oacute;n de desplazamiento, aunque la atenci&oacute;n prioritaria a las necesidades de la misma es un imperativo para diferentes instancias del Estado, debe advertirse que esto no implica que se dejen de regular o establecer formas de encauzar la ayuda destinada a este sector de poblaci&oacute;n. La simple condici&oacute;n de desplazado no habilita de manera autom&aacute;tica para recibir subvenciones, puesto que se requiere de unos m&iacute;nimos legales para su entrega. En el caso concreto del derecho a la vivienda para la poblaci&oacute;n desplazada en Bogot&aacute; D.C. existe una regulaci&oacute;n,&nbsp; que obedece tambi&eacute;n a proyectos y recursos destinados en cada vigencia fiscal para el cumplimiento de las metas.</p>
<p style="text-align: center;">
	<br />
	<u><strong>IMPROCEDENCIA DE LA ACCI&Oacute;N DE TUTELA EN RELACI&Oacute;N CON METROVIVIENDA</strong></u></p>
<p style="text-align: justify;">
	<br />
	Con fundamento en el anterior an&aacute;lisis, el Decreto 2591 de 1991 establece la procedencia de la Acci&oacute;n de Tutela de la siguiente manera:<br />
	<br />
	<em>&ldquo;Art&iacute;culo 5o. PROCEDENCIA DE LA ACCION DE TUTELA: La acci&oacute;n de tutela procede contra toda acci&oacute;n u omisi&oacute;n de las autoridades p&uacute;blicas, que haya violado, viole o amenace violar cualquiera de los derechos de que trata el art&iacute;culo 2o. de esta ley. Tambi&eacute;n procede contra acciones u omisiones de particulares, de conformidad con lo establecido en el Cap&iacute;tulo III de este Decreto. La procedencia de la tutela en ning&uacute;n caso est&aacute; sujeta a que la acci&oacute;n de la autoridad o del particular se haya manifestado en un acto jur&iacute;dico escrito.&rdquo;</em><br />
	<br />
	Nos permitimos afirmar que esta acci&oacute;n constitucional es IMPROCEDENTE, por cuanto no existe violaci&oacute;n, vulneraci&oacute;n o amenaza de un derecho fundamental por parte de METROVIVIENDA, al no ser en el Distrito Capital la entidad responsable de la asignaci&oacute;n y administraci&oacute;n de los recursos del Subsidio Distrital de Vivienda, ni de la competencia para la estabilizaci&oacute;n de las familias que se encuentran en situaci&oacute;n de desplazamiento interno forzado por la violencia.<br />
	Con base en lo anteriormente expuesto, me permito formular muy respetuosamente la siguiente:</p>
<p style="text-align: center;">
	<br />
	<strong><u>PETICI&Oacute;N</u></strong></p>
<p style="text-align: justify;">
	<br />
	Por todo lo anterior se&ntilde;or Juez, de acuerdo con las normas parcialmente transcritas y la Jurisprudencia citada, se solicita denegar las pretensiones de la acci&oacute;n de tutela impetrada, respecto a METROVIVIENDA por considerarla improcedente, debido a que esta entidad no vulner&oacute; o amenaza vulnerar derecho fundamental alguno del accionante, siendo improcedente tutelar los derechos fundamentales invocados, conforme se demostr&oacute; en la parte motiva del presente escrito de contestaci&oacute;n.<br />
	<br />
	Cordialmente,<br />
	<br />
