	<strong>Asunto:&nbsp;&nbsp;</strong> &nbsp;CONTESTACI&Oacute;N ACCI&Oacute;N DE TUTELA METROVIVIENDA. DEMANDA TEMERARIA<br />
	<strong>Radicado:&nbsp;&nbsp;</strong> &nbsp;&nbsp;&nbsp;&nbsp;<br />
	<br />
	<strong>ILVA NUBIA HERRERA G&Aacute;LVEZ</strong>, mayor de edad, vecina y residente en esta ciudad, identificada con la c&eacute;dula de ciudadan&iacute;a No. 41.780.295 de Bogot&aacute;, en mi calidad de Directora Jur&iacute;dica de Metrovivienda, nombrada mediante Resoluci&oacute;n&nbsp; No. 120&nbsp; del 29 de octubre de 2013, debidamente posesionada mediante Acta No. 79 del primero de noviembre de 2013, con funciones de Representaci&oacute;n Legal de <strong>METROVIVIENDA</strong>, persona jur&iacute;dica de derecho p&uacute;blico, Empresa y Industrial y Comercial del Orden Distrital, creada por el Acuerdo 15 de 1998, vinculada a la Secretar&iacute;a Distrital del H&aacute;bitat de la Alcald&iacute;a Mayor de Bogot&aacute;, mediante Acuerdo 257 del 30 de noviembre de 2006 del Concejo de Bogot&aacute;, dentro del t&eacute;rmino de dos (2) d&iacute;as concedidos por el despacho, pronunci&aacute;ndome&nbsp; primeramente en la temeridad del accionante al instaurar por segunda vez la misma acci&oacute;n de tutela que ya hab&iacute;a presentado en agosto de 2013 con los mismos demandados, bajo los mismos sustentos de hecho y de derecho que fue adelantada ante el Juzgado Octavo Civil del Circuito de de Bogot&aacute; D.C. (se anexan copias del auto de traslado de las demanda, apartes de la demanda y fotocopia de la c&eacute;dula de ciudadan&iacute;a). Nos llama la atenci&oacute;n que en las dos oportunidades tanto el Juzgado Octavo como &eacute;ste en el oficio que notifica el auto admisorio de la demanda,&nbsp; el n&uacute;mero de identificaci&oacute;n del accionante 3.207.941,&nbsp; no corresponde con el mencionado en los textos de las demandas, que es el mismo n&uacute;mero de la fotocopia de la c&eacute;dula, 93.349.876. De igual manera y como se contest&oacute; en las dos oportunidades, en relaci&oacute;n con los hechos que supuestamente ata&ntilde;en a esta Entidad, procedemos a informar, que por las razones que expondremos&nbsp; en la presente, no es Metrovivienda la entidad Distrital actualmente responsable de administrar y otorgar los recursos del Subsidio Distrital de Vivienda, siendo esta la Secretar&iacute;a Distrital del H&aacute;bitat quien inscribe, postula, califica, asigna y entrega los recursos del subsidio a los hogares que seg&uacute;n la reglamentaci&oacute;n pueden acceder al Subsidio Distrital de Vivienda.&nbsp; &nbsp;<br />
	<br />
	Procedo ante el Despacho de conocimiento a proponer de manera previa la siguiente:</p>
<p style="text-align: center;">
	<br />
	<br />
	<u><strong>ACTUACI&Oacute;N TEMERARIA POR PARTE DEL ACCIONANTE</strong></u></p>
<p style="text-align: justify;">
	<br />
	<br />
	El art&iacute;culo 38 del Decreto 2591 de 1991 por el cual se reglamenta la acci&oacute;n de tutela es claro, en manifestar que hay actuaci&oacute;n temeraria por parte del Accionante &ldquo;Cuando, sin motivo expresamente justificado, la misma acci&oacute;n de tutela sea presentada por la misma persona o su representante ante varios jueces o tribunales, se rechazar&aacute;n o decidir&aacute;n desfavorablemente todas las solicitudes. (&hellip;)&rdquo;<br />
	<br />
	El accionante ha instaurado la misma acci&oacute;n de tutela en la que se ha visto involucrada&nbsp; METROVIVIENDA en otra oportunidad anterior: la primera, ante el Juzgado Octavo Civil del Circuito de de Bogot&aacute; D.C., bajo la radicaci&oacute;n 11001310300820130049800, de agosto&nbsp; de 2013, existiendo en dicho proceso fallo en primera instancia del 12 de agosto que protege el derecho de petici&oacute;n desvinculando a METROVIVIENDA.<br />
	&nbsp;<br />
	As&iacute; las cosas, la presente acci&oacute;n de tutela debe ser rechazada y el accionante como consecuencia, debe asumir los efectos del falso juramento establecido en el numeral VIII de la acci&oacute;n de tutela en referencia en lo que a METROVIVIENDA concierne.</p>
<p style="text-align: center;">
	<br />
	<br />
	<u><strong>EXCEPCI&Oacute;N DE M&Eacute;RITO</strong></u></p>
<p style="text-align: justify;">
	<br />
	<br />
	Pese a la actuaci&oacute;n temeraria del Accionante, nos permitimos pronunciarnos frente a lo expuesto en la acci&oacute;n de tutela de la referencia, indicando que seg&uacute;n el se&ntilde;or FERNANDO PATI&Ntilde;O C.C. 93.349.876 de San Antonio - Tolima,&nbsp; supuestamente se le est&aacute;n amenazando o vulnerando los siguientes derechos: fundamentales: (1) A la vida digna; (2)&nbsp; Vivienda digna;&nbsp; (3) Uni&oacute;n familiar, (4) a la dignidad humana, (5) seguridad social, (6) protecci&oacute;n a la poblaci&oacute;n desplazada, (7) la igualdad y la reparaci&oacute;n integral de v&iacute;ctimas, (8) estabilizaci&oacute;n socioecon&oacute;mica y trabajo en los proyectos productivos o generaci&oacute;n de ingresos, frente a los cuales plantea carencia de acciones tendientes a la estabilizaci&oacute;n de su situaci&oacute;n, hechos estos que no encuentran relaci&oacute;n con la competencia de Metrovivienda, tal como se explicar&aacute; en detalle en apartados posteriores.<br />
	<br />
	En ese orden de ideas, interpongo al Despacho judicial <strong>FALTA DE LEGITIMACI&Oacute;N EN LA CAUSA POR PASIVA</strong>, toda vez que en relaci&oacute;n con ninguno de los hechos narrados, Metrovivienda en la actualidad tiene dentro de sus competencias&nbsp; la posibilidad de brindar&nbsp; estabilizaci&oacute;n socioecon&oacute;mica, y&nbsp; especificamos que en cuanto&nbsp; al otorgamiento de Subsidios de Vivienda adem&aacute;s de que a la fecha esta entidad no tiene competencia para otorgar Subsidios Distritales de Vivienda, como se narrar&aacute;&nbsp; en apartados posteriores, la presunta vulneraci&oacute;n radica en el hecho de no haber obtenido Subsidio Familiar de Vivienda tramitado ante una caja de compensaci&oacute;n familiar y otorgado por Fonvivienda, requisito sin el cual es imposible normativamente la asignaci&oacute;n de un Subsidio Distrital de Vivienda, <u>esto &uacute;ltimo se reitera, no siendo ya de competencia de esta entidad puesto que mediante el Decreto Distrital 583 de 2007 se le asign&oacute; a la Secretar&iacute;a Distrital del H&aacute;bitat la competencia para su otorgamiento y asignaci&oacute;n,</u> funci&oacute;n que se le hab&iacute;a otorgado a Metrovivienda a trav&eacute;s de los Decretos Distritales 226 de 2005 y 200 de 2006, derogados por el Decreto Distrital 063 de 2009, por lo tanto y de acuerdo al ordenamiento jur&iacute;dico de creaci&oacute;n de la entidad, esta tiene como prop&oacute;sito esencial asuntos diferentes a los alegados por el actor de tutela, siendo ellos:</p>
<p style="text-align: justify;">
	<br />
	<em>&nbsp;&ldquo;...A. Promover la oferta masiva de suelo urbano para facilitar la ejecuci&oacute;n de Proyectos Integrales de Vivienda de Inter&eacute;s Social.<br />
	B. Desarrollar las funciones propias de los bancos de tierras o bancos inmobiliarios, respecto de inmuebles destinados en particular para la ejecuci&oacute;n de proyectos urban&iacute;sticos que contemplen la provisi&oacute;n de Vivienda de Inter&eacute;s Social Prioritaria.<br />
	C. Promover la organizaci&oacute;n comunitaria de familias de bajos ingresos para facilitar su acceso al suelo destinado a la vivienda de inter&eacute;s social prioritaria.&rdquo;.</em></p>
<p style="text-align: center;">
	<br />
	<u><strong>PRONUNCIAMIENTO FRENTE A LOS HECHOS DE LA ACCI&Oacute;N:</strong></u></p>
<p style="text-align: justify;">
	<br />
	No se puede considerar en el presente caso responsable a METROVIVIENDA por los derechos fundamentales supuestamente vulnerados y especialmente en lo que concierne a su necesidad de contar con una soluci&oacute;n habitacional definitiva, obteniendo para el efecto el subsidio familiar de vivienda que a la fecha no le ha sido otorgado, para luego y en caso de que este le haya sido asignado en la ciudad de Bogot&aacute;, iniciar el proceso tendiente a la obtenci&oacute;n del Subsidio Distrital de Vivienda.<br />
	<br />
	As&iacute; las cosas, nos pronunciaremos sobre los hechos <strong><u>nuevamente</u></strong> alegados de la siguiente manera:<br />
	<br />
	En cuanto a la asignaci&oacute;n de subsidios,&nbsp; el se&ntilde;or FERNANDO PATI&Ntilde;O C.C. 93.349.876&nbsp;&nbsp;&nbsp; manifiesta en la demanda de tutela&nbsp; que: &ldquo;<em>Por otra parte,&nbsp; el no asignar oportunamente los subsidios de vivienda por parte de <strong>FONVIVIENDA</strong>, nos perjudica, ya que la administraci&oacute;n Distrital hace entrega de un subsidio de vivienda a los desplazados que nos encontramos en la ciudad de Bogot&aacute;, previo a la entrega del subsidio nacional como complemento para la soluci&oacute;n habitacional debemos, porque de no ser as&iacute;,&nbsp; se nos estar&iacute;a vulnerando el derecho a la igualdad. Para acreditar mi afirmaci&oacute;n, ruego al se&ntilde;or Juez requerir a la Alcald&iacute;a Mayor&nbsp; de Bogot&aacute;, con el fin de que esta, corrobore mi informaci&oacute;n, con el fin de que su&nbsp; fallo se ajuste a derecho.&rdquo;</em> (Folio 9 de la acci&oacute;n de tutela)<br />
	&nbsp;<br />
	Se insiste en que <strong>METROVIVIENDA</strong> no es la entidad distrital encargada de administrar y otorgar el Subsidio Distrital de Vivienda, por lo tanto no contamos con los elementos normativos, financieros y log&iacute;sticos para asignar subsidios, como se indic&oacute; anteriormente. Actualmente, esta funci&oacute;n la cumple la Secretar&iacute;a Distrital del H&aacute;bitat. Pero con el fin de informar a su Despacho los requisitos que debe cumplir la poblaci&oacute;n desplazada para acceder al Subsidio Distrital de Vivienda, me permito informar lo siguiente:<br />
	<br />
	El Subsidio Distrital de Vivienda para hogares en situaci&oacute;n de desplazamiento interno forzado por la violencia es complementario del Subsidio Familiar de Vivienda otorgado por la Naci&oacute;n, otorgado por una sola vez al hogar beneficiario, sin cargo de restituci&oacute;n, con el fin de facilitar una soluci&oacute;n habitacional dentro de las modalidades de vivienda nueva o usada y mejoramiento de vivienda.<br />
	<br />
	De tal manera, que con el fin de brindar una estabilizaci&oacute;n socioecon&oacute;mica a la poblaci&oacute;n desplazada y en cumplimiento de las directrices contenidas en diferentes Sentencias y Autos proferidos por la Corte Constitucional, entre otras la Sentencia T-025 de 2004, el Alcalde Mayor de Bogot&aacute;, expidi&oacute; el Decreto Distrital 200 de 20061, norma que actualmente se encuentra derogada <strong>otorg&aacute;ndole tal competencia a la Secretar&iacute;a Distrital del H&aacute;bitat, confiri&eacute;ndole la facultad de convocar, postular y asignar Subsidios Distritales de Vivienda2</strong> para las modalidades de adquisici&oacute;n de vivienda nueva o usada, mejoramiento de vivienda y construcci&oacute;n en sitio propio, con el fin de brindar un apoyo a las <strong>soluciones habitacionales</strong> de la poblaci&oacute;n desplazada.<br />
	<br />
	La Alcald&iacute;a Mayor de Bogot&aacute; expidi&oacute; el Decreto Distrital 063 del 2 de marzo de 2009 que reglament&oacute; el otorgamiento del Subsidio Distrital de Vivienda, el cual fue derogado por el Decreto Distrital 539 del 23 de noviembre de 2012 <em>&quot;Por el cual se reglamenta el subsidio distrital de vivienda en especie en el marco del Plan de Desarrollo Econ&oacute;mico, Social, Ambiental y de Obras P&uacute;blicas Para Bogot&aacute; D. C. 2012 - 2016 - Bogot&aacute; Humana</em>&quot;,&nbsp; que igualmente considera la situaci&oacute;n de la poblaci&oacute;n desplazada y contin&uacute;a otorgando el SDV complementario al Subsidio Familiar de Vivienda que otorga el Gobierno Nacional, en los t&eacute;rminos de la ley 1537 de 2012, ley de vivienda.<br />
	<br />
	Observ&aacute;ndose con lo anterior, que el Distrito Capital ni Metrovivienda, han incumplido o presuntamente violado los derechos enunciados por la accionante y los otorgados por la Ley y por v&iacute;a jurisprudencial a la poblaci&oacute;n desplazada, tal como ya se ha fallado sobre lo mismo en instancias judiciales.<br />
	<br />
	Adicional a lo anterior, el Concejo de Bogot&aacute;, D.C., mediante el Acuerdo 468 de 2011, autoriz&oacute; al Alcalde Mayor para aplicar el Subsidio Distrital de Vivienda para Hogares que se encuentren en situaci&oacute;n de desplazamiento interno forzado por la violencia en &aacute;reas por fuera del per&iacute;metro del Distrito Capital, con el fin de facilitar su retorno, al respecto contempla:</p>
<p style="text-align: justify;">
	<br />
	<em><strong>&ldquo;ART&Iacute;CULO 1&ordm;</strong>.- Autorizar al Alcalde Mayor para aplicar el Subsidio Distrital de Vivienda para Hogares que se encuentren en situaci&oacute;n de Desplazamiento Interno Forzado por la Violencia para su reubicaci&oacute;n o retorno.<br />
	<strong>ART&Iacute;CULO 2</strong>. El Subsidio Distrital de Vivienda para Hogares en condici&oacute;n de Desplazamiento Interno Forzado por la Violencia ser&aacute; asignado para aquellos que se encuentren inscritos en el Distrito Capital en el Registro &Uacute;nico de Poblaci&oacute;n Desplazada.<br />
	<strong>ART&Iacute;CULO 3</strong>. El monto que se otorgue como Subsidio Distrital de Vivienda a cada hogar en situaci&oacute;n de Desplazamiento Interno Forzado ser&aacute; hasta por el mismo valor del subsidio de vivienda que otorga el gobierno Nacional.<br />
	<strong>ART&Iacute;CULO 4</strong>. La Secretar&iacute;a Distrital del H&aacute;bitat informar&aacute; al alcalde municipal del lugar en el que se aplique el subsidio distrital de vivienda, a las entidades distritales y a FONVIVIENDA, para los efectos de su competencia.<br />
	<strong>ART&Iacute;CULO 5</strong>. La administraci&oacute;n distrital establecer&aacute; el procedimiento para el desembolso del Subsidio Distrital de Vivienda...&rdquo;</em></p>
<p style="text-align: justify;">
	<br />
	En ese orden de ideas, el<strong> Distrito Capital y en especial Metrovivienda no han incumplido o presuntamente violado los derechos enunciados por el accionante y los otorgados por la Ley y por v&iacute;a jurisprudencial a la poblaci&oacute;n desplazada,</strong> toda vez que Metrovivienda y la Secretar&iacute;a Distrital del H&aacute;bitat, han contribuido al mejoramiento de las condiciones socioecon&oacute;micas de la poblaci&oacute;n desplazada, asignando recursos econ&oacute;micos a trav&eacute;s del Subsidio Distrital de Vivienda, para cubrir las necesidades habitacionales que tiene la poblaci&oacute;n en esta situaci&oacute;n, dirigiendo de esta manera la actuaci&oacute;n de la Administraci&oacute;n Distrital al cumplimiento de los fines consagrados en el<strong> art&iacute;culo 13 y 51 de la Constituci&oacute;n Pol&iacute;tica3.</strong><br />
	<br />
	2. En cuanto a la estabilizaci&oacute;n socioecon&oacute;mica. Es necesario indicar que esta obligaci&oacute;n es competencia del&nbsp; Departamento Administrativo para la prosperidad Social.<br />
	<br />
	As&iacute;, Metrovivienda no desarrolla ni fomenta proyectos productivos, ni tiene injerencia alguna en la toma de las decisiones adoptadas por los entidades del Estado en otros niveles, como el Departamento Administrativo para la prosperidad Social, puesto que no hace parte del sector central de la rama ejecutiva del poder p&uacute;blico en el orden nacional. En tal sentido, no es la llamada a responder o al menos presentar justificaci&oacute;n acerca de las presuntas dilaciones en que haya incurrido o pueda incurrir la citada dependencia presidencial frente al accionante.<br />
	<br />
	Con claridad en cuanto a lo anterior, s&oacute;lo con fines ilustrativos y sin perjuicio de lo que manifieste el Departamento Administrativo para la prosperidad Social al momento de contestar esta acci&oacute;n, resulta pertinente indicar que en cuanto a la integraci&oacute;n de la poblaci&oacute;n en situaci&oacute;n de desplazamiento al desarrollo de proyectos productivos por parte del Gobierno Nacional, es &eacute;ste quien define -de acuerdo con sus disponibilidades- las condiciones y requisitos que deben reunir la poblaci&oacute;n desplazada en general y la accionante en particular, para tener derecho al auxilio econ&oacute;mico.<br />
	<br />
	Ello con fundamento en las siguientes razones de derecho:<br />
	<br />
	La Ley 387 de 1997 dispone que el Fondo Nacional para la Atenci&oacute;n Integral a la Poblaci&oacute;n en Situaci&oacute;n de Desplazamiento interno forzado por la Violencia tiene por objeto<em>&ldquo;financiar y/o cofinanciar los programas de prevenci&oacute;n del desplazamiento, de atenci&oacute;n humanitaria de emergencia, de retorno, de estabilizaci&oacute;n y consolidaci&oacute;n socioecon&oacute;mica y la instalaci&oacute;n y operaci&oacute;n de la Red Nacional de Informaci&oacute;n.&rdquo;</em><br />
	<br />
	Por su parte, el art&iacute;culo 25 de la misma ley ordena que &ldquo;el Gobierno Nacional har&aacute; los ajustes y traslados presupuestales correspondientes en el Presupuesto General de la Naci&oacute;n para dejar en cabeza del Fondo las apropiaciones necesarias para el cumplimiento de sus objetivos&rdquo;.<br />
	<br />
	Adicionalmente los art&iacute;culos 16, 17, 20, 21, 22, 25, 26 y 27 del Decreto 2569 de 2000, reglamentario de la ley 387 de 1997, condicionaron el acceso, tanto a la ayuda humanitaria de emergencia como a los programas de estabilizaci&oacute;n socioecon&oacute;mica, a la existencia de disponibilidades presupuestales. A manera de ejemplo, el art&iacute;culo 22 dispone que<em> &ldquo;en atenci&oacute;n a los principios de solidaridad y de proporcionalidad, la Red de Solidaridad Social destinar&aacute; de los recursos que para tal fin reciba del presupuesto nacional y de manera proporcional al tama&ntilde;o y composici&oacute;n del grupo familiar, un monto m&aacute;ximo equivalente en bienes y servicios, de acuerdo con la disponibilidad presupuestal.&rdquo;</em><br />
	<br />
	De acuerdo con lo expuesto y en virtud de lo resuelto por la Corte Constitucional en la sentencia T-025 de 2002, el Gobierno Nacional debe garantizar la protecci&oacute;n de la poblaci&oacute;n desplazada, por lo cual le resulta imperioso destinar el presupuesto necesario para que los derechos fundamentales de este grupo de persona tengan plena garant&iacute;a. As&iacute; las cosas, el Gobierno Nacional es el encargado de organizar las disponibilidades presupuestales para atender a la poblaci&oacute;n desplazada, de conformidad con los recursos de los que disponga para ello y con respeto a algunos factores de atenci&oacute;n prioritaria<br />
	<br />
	Ahora bien, para el caso de la poblaci&oacute;n en situaci&oacute;n de desplazamiento, aunque la atenci&oacute;n prioritaria a las necesidades de la misma es un imperativo para diferentes instancias del Estado, debe advertirse que esto no implica que se dejen de regular o establecer formas de encauzar la ayuda destinada a este sector de poblaci&oacute;n. La simple condici&oacute;n de desplazado no habilita de manera autom&aacute;tica para recibir subvenciones, puesto que se requiere de unos m&iacute;nimos legales para su entrega. En el caso concreto del derecho a la vivienda para la poblaci&oacute;n desplazada en Bogot&aacute; D.C. existe una regulaci&oacute;n,&nbsp; que obedece tambi&eacute;n a proyectos y recursos destinados en cada vigencia fiscal para el cumplimiento de las metas.<br />
	&nbsp;</p>
<p style="text-align: center;">
	<br />
	<u><strong>IMPROCEDENCIA DE LA ACCI&Oacute;N DE TUTELA EN RELACI&Oacute;N CON METROVIVIENDA</strong></u></p>
<p style="text-align: justify;">
	<br />
	Con fundamento en el anterior an&aacute;lisis, el Decreto 2591 de 1991 establece la procedencia de la Acci&oacute;n de Tutela de la siguiente manera:<br />
	<br />
	<em>&ldquo;Art&iacute;culo 5o. PROCEDENCIA DE LA ACCION DE TUTELA: La acci&oacute;n de tutela procede contra toda acci&oacute;n u omisi&oacute;n de las autoridades p&uacute;blicas, que haya violado, viole o amenace violar cualquiera de los derechos de que trata el art&iacute;culo 2o. de esta ley. Tambi&eacute;n procede contra acciones u omisiones de particulares, de conformidad con lo establecido en el Cap&iacute;tulo III de este Decreto. La procedencia de la tutela en ning&uacute;n caso est&aacute; sujeta a que la acci&oacute;n de la autoridad o del particular se haya manifestado en un acto jur&iacute;dico escrito.&rdquo;</em><br />
	<br />
	<strong>As&iacute; mismo, es una actuaci&oacute;n temeraria de conformidad con el art&iacute;culo 38 del Decreto 2591 de 1991, la del accionante de instaurar nuevamente la misma acci&oacute;n de tutela contra METROVIVIENDA, cuando ya existen pronunciamientos judiciales al respecto, aprovech&aacute;ndose as&iacute; de la naturaleza de este tipo de acci&oacute;n y generando a su vez congesti&oacute;n en los despachos judiciales.</strong></p>
<p style="text-align: justify;">
	<br />
	Con base en lo anteriormente expuesto, me permito formular muy respetuosamente la siguiente:</p>
<p style="text-align: center;">
	<br />
	<u><strong>PETICI&Oacute;N</strong></u></p>
<p style="text-align: justify;">
	<br />
	Por todo lo anterior se&ntilde;or Juez de acuerdo con las normas parcialmente transcritas y la Jurisprudencia citada, se solicita rechazar la presente acci&oacute;n de tutela por corresponder a una actuaci&oacute;n temeraria consagrada en el art&iacute;culo 38 del Decreto 2591 de 1991 y por ende denegar las pretensiones de la acci&oacute;n de tutela impetrada, respecto a METROVIVIENDA, por considerarla improcedente, debido a que esta entidad como ya lo han decido fallos judiciales, no vulner&oacute; o amenaz&oacute; vulnerar derecho fundamental alguno del Accionante, conforme se demostr&oacute; en la parte motiva del presente escrito de contestaci&oacute;n sobre el que como ya se ha venido enunciando, ya cuentan con pronunciamientos judiciales.<br />
	<br />
	Del se&ntilde;or Juez, respetuosamente,<br />
	<br />
	<br />
	<strong>Ilva Nubia Herrera G&aacute;lvez</strong><br />
	Directora Jur&iacute;dica<br />
